sys_variable_value.value:
(function execute(inputs, outputs) {
  // var contacts = inputs.m2m.contacts
  outputs.contact_records = [];
  while (inputs.m2m.next()) {
    gs.info(inputs.m2m.contacts.formal_name.toString())
  	var contact = {};
    contact.formal_name = inputs.m2m.contacts.formal_name.toString();
    contact.type = inputs.m2m.contacts.type.toString();
    contact.email = inputs.m2m.contacts.email.toString();
    contact.phone_and_extension = inputs.m2m.contacts.phone_and_extension.toString();
    contact.dod_aac = inputs.m2m.contacts.dodaac.toString();
    if (contact.rank_and_components) {
      contact.rank_and_components = {
        name: inputs.contacts.rank_and_components.name.toString(),
        branch: inputs.contacts.rank_and_components.branch.toString(),
        grade: inputs.contacts.ranks_and_components.grade.toString(),
        abbr: inputs.contacts.ranks_and_components.abbreviation.toString()
      }
    } else {
      contact.rank_and_components = null;
    }
    outputs.contact_records.push(contact)
  }

})(inputs, outputs);

